import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>hello</h1>
      <input />
      <button>Add Todo</button>
      <ul>
        <li>Take dogs for a walk</li>
        <li>Take the rubbish out</li>
      </ul>
    </div>
  );
}

export default App;
